import ReactDOM from "react-dom";
import React from "react";

const cars = [
  {
    carName: "Malibu",
    carPrice: 30000,
  },
  {
    carName: "Gentra",
    carPrice: 13000,
  },
  {
    carName: "Tracker",
    carPrice: 25000,
  },
  {
    carName: "Cobalt",
    carPrice: 9000,
  },
  {
    carName: "Spark",
    carPrice: 7000,
  },
  {
    carName: "Captiva",
    carPrice: 27000,
  },
];

ReactDOM.render(
  <div>
    <div className="container">
      <div className="row">
        <div className="col-12">
          <table className="table table-hover table-light">
            <thead className="thead table-">
              <tr>
                <th>â„–</th>
                <th>Car</th>
                <th>Car Price</th>
              </tr>
            </thead>

            <tbody>{cars.map((item, index) => {
              return <tr>
                <td>{index + 1}</td>
                <td>{item.carName}</td>
                <td>{item.carPrice}</td>
              </tr>
            })}</tbody>
          </table>
        </div>
      </div>
    </div>
  </div>,
  document.querySelector("#root")
);
